  false,\n\t\"url\": null,\n\t\"notes\": \"One of the programs of the Aleutian Islands
  National Wildlife Refuge is to locate and census colonial nesting seabirds and marine
  mammals on the refuge. From June 24 through July 8, 1973 the refugeu2019s research
  vessel Aleutian Tern was used to conduct such a survey in the eastern Aleutian Islands.
  The main objectives of this expedition were to conduct detailed biological reconnaissances
  of Bogoslof and Amak Islands.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
